Liebe Mama, 

Heute war eine so tolle Nacht. Als du ins Bett kamst war ich wach, weil ich einfach nicht schlafen konnte und habe dich freudig gerufen. Endlich kuscheln. Und das haben wir dann die gesamte Nacht getan, das hat mir gefehlt. Die letzten zwei Wochen war es anders. Du warst zwar da wenn ich gerufen habe, aber wir konnten nicht kuscheln. 
Aber das brauche ich doch gerade jetzt so sehr. Wenn ich wach werde tut mein ganzer Mund weh. Ich weiß gar nicht wieso, aber ich weiß was hilft. Ich drehe mich einfach zur Seite und da bist du. Sobald du mich in den Arm nimmst, sobald ich deinen Geruch einatme und du mir über den Rücken streichelst verschwindet der Schmerz. 
Ich will dir Danke sagen dass du da bist. Und wenn ich zur Zeit manchmal schwierig bin liegt das nur daran, dass ich gerade überfordert bin mit meinen ganzen neuen Fähigkeiten und mein Mund einfach immer weh tut. Aber wenn du da bist, dann ist alles gut. 
Ich liebe dich und weiß dass du immer für mich da bist. 

Deine Motte

